import './About.css';

function About() {
  return (
      <div class="about">
            <div class="text-container">
                <text class="big-text"> hey there! </text>
                <text class="small-text"> I’m Izzie Lau and I’m a junior at UC Berkeley. I’m interested in the intersection of human-computer interaction with real-world applications of CS and data science. I’ve previously worked on web development, mobile/extended reality applications, and machine learning projects and am always looking for ways to expand my knowledge to help my community. </text>
            </div>
            <div class="button-container">

            </div>
      </div>
  );
}

export default About;
